import React from 'react';

const App = () => {

  const recherche = () => {

    fetch('http://locahost' , {
      method: 'GET',
      body: null,
      headers: {
        'Content-Type': 'application/json'
      }
    }).then(res => {
      return console.log(res)
    })

    return console.log('cool recherche');
  }

  return(

    <div>
        <h2>Salut tous le monde</h2>
        { recherche() }
    </div>
  )
}

export default App;
